/** @brief Type of mission items being requested/sent in mission protocol. */
#ifndef HAVE_ENUM_MACE_MISSION_TYPE
#define HAVE_ENUM_MACE_MISSION_TYPE
typedef enum MACE_MISSION_TYPE
{
   MACE_MISSION_TYPE_AUTO=0, /* Items are mission commands for main auto mission. | */
   MACE_MISSION_TYPE_GUIDED=1, /* Items are mission commands for guided mission. | */
   MACE_MISSION_TYPE_ROI=2, /* Items are regions of interest that the vehicle should visit in a guided mission. | */
   MACE_MISSION_TYPE_FENCE=3, /* Specifies GeoFence area(s). Items are MAV_CMD_FENCE_ GeoFence items. | */
   MACE_MISSION_TYPE_RALLY=4, /* Specifies the rally points for the vehicle. Rally points are alternative RTL points. Items are MAV_CMD_RALLY_POINT rally point items. | */
   MACE_MISSION_TYPE_ALL=255, /* Only used in MISSION_CLEAR_ALL to clear all mission types. | */
   MACE_MISSION_TYPE_ENUM_END=256, /*  | */
} MACE_MISSION_TYPE;
#endif

/** @brief Type of mission items being requested/sent in mission protocol. */
#ifndef HAVE_ENUM_MACE_MISSION_STATE
#define HAVE_ENUM_MACE_MISSION_STATE
typedef enum MACE_MISSION_STATE
{
   MACE_MISSION_CURRENT=0, /* Items are mission commands for main auto mission and are received via the autopilot and aircraft module. | */
   MACE_MISSION_ONBOARD=1, /* Items are mission ready and have been acknowledged by the aircraft module for processing. | */
   MACE_MISSION_PROPOSED=2, /* Items are mission ready but have been generated by a module not related to the aircraft and need to be pushed towards the appropriate aircraft module. | */
   MACE_MISSION_TRANSMITTED=3, /* Items have been distributed and received by the appropriate MACE instance connected to the associated aircraft module. | */
   MACE_MISSION_STATE_ENUM_END=4, /*  | */
} MACE_MISSION_STATE;
#endif

/** @brief Type of mission items being requested/sent in mission protocol. */
